import styled from "styled-components"
const CollectionItem = styled.div`
    display:flex;
    width: 100%;
    height: 100%;
    overflow: hidden;
    position: relative;
    text-align: center;
    cursor: default;
    background: #42b078;
`
export default CollectionItem
